import React, { useState, useEffect } from 'react';
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';
import highchartsMap from 'highcharts/modules/map';
import mapData_metro from './topo_fm';
import mapData_dom from './topo_dom';
import mapDataIE from './topo';
import mapDataIE2 from './topo2';
highchartsMap(Highcharts);


console.log(typeof mapDataIE)
console.log(Object.getPrototypeOf(mapDataIE) === Map.prototype)

const staticOptions_metro = {
  chart: {
    styledMode: true,
  },
  credits: {
    enabled: false,
  },
  title: {
    text: ' ',
    useHTML: true,
  },
  
  tooltip: {
    headerFormat: ' ',
    pointFormat: `
      <b>{point.name}</b>: {point.value}`,
  },

  series: [
    {
      name: 'Basemap',
      mapData: mapData_metro,
      borderColor: '#FFC3BA',
      borderWidth: 0.5,
      nullColor: '#FFEAE4',
      showInLegend: false,
      allowPointSelect: true,
      dataLabels: {
        enabled: false,
        format: '{point.name}',
        color: '#000',
      },
      states: {
        select: {
          borderColor: '#B5ACFF',
          color: '#7A77FF',
        },
      },
    },
  ],
 }; 

 const staticOptions_dom = {
  title: {
    text: ' ',
    useHTML: true,
  },
  series: [
    {
      name: 'Basemap',
      mapData: mapData_dom,
      borderColor: '#FFC3BA',
      borderWidth: 0.5,
      nullColor: '#FFEAE4',
      showInLegend: false,
      allowPointSelect: true,
      dataLabels: {
        enabled: true,
        format: '{point.name}',
        color: '#000',
      },
      states: {
        select: {
          borderColor: '#B5ACFF',
          color: '#7A77FF',
        },
      },
    },
  ],
 }; 


const staticOptions = {
  title: {
    text: ' ',
    useHTML: true,
  },
 chart: {
   styledMode: true,
 },
 credits: {
   enabled: false,
 },
 series: [
   {
     name: 'Basemap',
     mapData: mapDataIE,
     borderColor: '#FFC3BA',
     borderWidth: 0.5,
     nullColor: '#FFEAE4',
     showInLegend: false,
     allowPointSelect: true,
     dataLabels: {
       enabled: false,
       format: '{point.name}',
       color: '#000',
     },
     states: {
       select: {
         borderColor: '#B5ACFF',
         color: '#7A77FF',
       },
     },
   },
 ],
};
const staticOptions2 = {
  title: {
    text: ' ',
    useHTML: true,
  },
  chart: {
    styledMode: true,
  },
  credits: {
    enabled: false,
  },
  series: [
    {
      name: 'Basemap',
      mapData: mapDataIE2,
      borderColor: '#FFC3BA',
      borderWidth: 0.5,
      nullColor: '#FFEAE4',
      showInLegend: false,
      allowPointSelect: true,
      dataLabels: {
        enabled: false,
        format: '{point.name}',
        color: '#000',
      },
      states: {
        select: {
          borderColor: '#B5ACFF',
          color: '#7A77FF',
        },
      },
    },
  ],
 };
 
 export default ({ data }) => {
  const [options_metro, setOptions_metro] = useState({});
  useEffect(() => {
    setOptions_metro({
      ...staticOptions_metro,
      series: [
        {
          ...staticOptions_metro.series[0],
          data: data,
        },
      ],
    });
  }, [data]);

  const [options_dom, setOptions_dom] = useState({});
  useEffect(() => {
    setOptions_dom({
      ...staticOptions_dom,
      series: [
        {
          ...staticOptions_dom.series[0],
          data: data,
        },
      ],
    });
  }, [data]);
 
  const [options, setOptions] = useState({});
 useEffect(() => {
   setOptions({
     ...staticOptions,
     series: [
       {
         ...staticOptions.series[0],
         data: data,
       },
     ],
   });
 }, [data]);

 const [options2, setOptions2] = useState({});
 useEffect(() => {
   setOptions2({
     ...staticOptions2,
     series: [
       {
         ...staticOptions2.series[0],
         data: data,
       },
     ],
   });
 }, [data]);


 return (
   <div>
      <HighchartsReact
     highcharts={Highcharts}
     constructorType={'mapChart'}
     options={options_metro}
   />

    <HighchartsReact
     highcharts={Highcharts}
     constructorType={'mapChart'}
     options={options_dom}
   />

     <HighchartsReact
     highcharts={Highcharts}
     constructorType={'mapChart'}
     options={options}
   />
   <HighchartsReact
     highcharts={Highcharts}
     constructorType={'mapChart'}
     options={options2}
   />
   </div>
   
   
 );
}
